import React, { useState } from 'react';
import FittoApp from './FittoApp';
import { Provider } from 'react-redux'
import store from './src/Cart'

const App = () => {

  return (
    <Provider store={store}>
      <FittoApp />
    </Provider> 
  );
};

export default App;
